import React from "react";

import "./veggies.css";
import { data } from "./TopSellingData";
export default function VeggiesSlider() {
  return (
    <>
      <div className="veggies-slider-wrap">
        {data.map((items) => (
          <div className="vegie-slider">
            <img src={items.photo_url} />
            <p>{items.name}</p>
          </div>
        ))}
      </div>
    </>
  );
}
